import logo from './logo.svg';
import './App.css';
import Hello from './components/hello'

function App() {
  return (
    <div className="App">


        <Hello />
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>

    </div>
  );
}

export default App;
